      async function handleSubmit (event)  {
        event.preventDefault();
        // console.log('formData',formData)
        const data ={
          'online_order': 0,
          'book_table': 1,
          'location': location,
          'rest_type': rest_type,
          'cus_type': cusine,
          'cost': 550,
        }
        console.log('data',data)
        await fetch('http://localhost:5000/api', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify(data)
        })
        .then(response => response.json())
        .then(data => {
          console.log(data);
          setResData(data)
        })
        .catch(error => {
          console.error('Error:', error);
        });
      }
      return (
        <section id="account" style={{flexDirection: 'row'}}>
         
          <h2>Enter restaurant details</h2>
            <form onSubmit={(e) => handleSubmit(e)}>
            <label>
              Online Order Details:{' '}
              <input onChange={() => setOnline(true)} type="radio" checked name="online_order" value={online} />Yes{' '}
              <input onChange={() => setOnline(false)}  type="radio" name="online_order" value={online} />No
            </label>
            <br />
            <label>
              Booking Facility:{' '}
              <input onChange={() => settable(true)} type="radio" checked name="booking_facility" value={table} />Yes{' '}
              <input onChange={() =>settable(false)} type="radio" name="booking_facility" value={table} />No
            </label>
            <br />
            <label>
              Location:{' '}
              <select onChange={(e) => {setlocation(e.target.value)}} name="Location">
                {
                  locations.map((location,index) => {
                    console.log('index',index)
                    return(
                      <option value={location}>{location}</option>
                    )
                  })
                }
              </select>
            </label>
            <br />
            <label style={{width: 1400}}>
              Restaurant Type:{' '}
              <select onChange={(e) => {console.log('rest_type',e.target.value);setRest_type(e.target.value)}} name="rest_type">
              {
                  rest_types.map((rest_type) => {
                    // console.log('rest_type',rest_type)
                    return(
                      <option value={rest_type}>{rest_type}
                      </option>
                    )
                  })
              }
              </select>
            </label>
            <br />
            <label>
              Cuisine Type:{' '}
              <div className="search-container">
              <input type="text" id="search-input" placeholder="Search..." value={searchText} onChange={handleSearch} />
              {searching && <ul id="search-results">
                {filteredNames.map(name => 
                <li onClick={() =>{setSearching(false);setCusine(name);setSearchText(name)}} key={name}>{name}</li>
                )}
              </ul>
              }
              </div>
            </label>
            <br />
            <label style={{width: 1400}}>
              Cost {' '} max(600):{' '}
              <input min="1" max="2000" value={cost_value} onChange={(e) => setCostValue(e.target.value)}  type="number" name="cost" />
            </label>
            <br />
            <input type="submit" value="Submit" />
          </form>
          
          
          
          {/* <About /> */}
        </section>
      );
